import Header from './components/Header';
import './App.css';

function App() {
  const data = {
    tit: {
      welcome: "Welcome to component and props corner",
      title: "React",
      subtitle: "Javascript Library",
    },
    welcome: "Welcome to component and props corner",
    title: "React",
    subtitle: "Javascript Library",
    user: {
      firstname: "John",
      lastname: "Sedrick",
    },
    techskill: ["HTML", "JS", "CSS", "React"],
    date: new Date(),
  };
  return (
    <div className="App">
      <Header header = {welcome}/>
    </div>
  );
}

export default App;
